  interface Records {
    Name: string;
    Translations: Translations;
    ID: number;
    Type: "Simple" | "Generic";
    Range: "Server" | "Client";
    Class: "Execution" | "Trigger" | "Control" | "Query" | "Arithmetic" | "Hidden";
    Family: string;
    Inputs: string[];
    Outputs: string[];
    TypeMappings?: TypeMapping[];
  }

  interface TypeMapping {
    GenericId: number;
    Type: string;
    InputsIndexOfConcrete: (number | null)[];
    OutputsIndexOfConcrete: (number | null)[];
  }

  const Language = ["cs", "de", "es", "fr", "it", "ja", "ko", "pl", "pt-BR",
  "ru", "tr", "zh-Hans", "zh-Hant"];

  type Language = typeof Language[number];

  type Translations = {
    [key in Language]: string;
  }

  interface EnumEntry {
    Name: string;
    Translations: Translations;
    ID: number; // This id is selected as index of concrete in Node EnumEqual
    Items: EnumItem[];
  }

  interface EnumItem {
    Name: string;
    Translations: Translations;
    ID: number; // This id is unique value for each item
  }

